import React, { useState, useEffect } from 'react';
import axios from 'axios';

const LogDisplay = () => {
  const [data, setData] = useState([]);
  const [activeLog, setActiveLog] = useState('wp_s3cu_form_on_landing');

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get(`https://localhost/backend/process_data.php?api=${activeLog}`);
        setData(response.data);
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData();
  }, [activeLog]);

  const renderHeaders = () => {
    const headers = activeLog === 'wp_s3cu_form_on_landing'
      ? ['ID', 'Main Point', 'Sex', 'Age', 'Params', 'Created At', 'Updated At']
      : ['ID', 'IP', 'DateTime', 'Request Method', 'URL', 'Protocol', 'Status Code', 'Response Size', 'Referrer', 'User Agent'];

    return (
      <thead>
        <tr>
          {headers.map((header, index) => (
            <th key={index}>{header}</th>
          ))}
        </tr>
      </thead>
    );
  };

  return (
    <div>
      <button onClick={() => setActiveLog("wp_s3cu_form_on_landing")}>
        Show WP_s3cu_form_on_landing
      </button>
      <button onClick={() => setActiveLog("apache_logs")}>
        Show Apache Logs
      </button>
      <table>
        {renderHeaders()}
        <tbody>
          {data.map((item, index) => (
            <tr key={index}>
                {Object.values(item).map((value, i) => <td key={i}>{value}</td>)}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default LogDisplay;
